const Home = () => {

  return (
    <div className="home">
      <div>
      <iframe src="https://giphy.com/embed/xUOwGdA2o7E4TPJICQ" width="700" height="270" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/europapark-fun-looping-xUOwGdA2o7E4TPJICQ"></a></p>
      </div>
        {/* <Navbar /> */}
